CREATE TABLE IF NOT EXISTS `django_migrations` (`id` INT AUTO_INCREMENT PRIMARY KEY, `app` varchar(255) NOT NULL, `name` varchar(255) NOT NULL, `applied` datetime NOT NULL) ENGINE=InnoDB DEFAULT CHARSET=utf8mb4 COLLATE=utf8mb4_unicode_ci;


CREATE TABLE IF NOT EXISTS `auth_group_permissions` (`id` INT AUTO_INCREMENT PRIMARY KEY, `group_id` INT NOT NULL REFERENCES `auth_group` (`id`) DEFERRABLE INITIALLY DEFERRED, `permission_id` INT NOT NULL REFERENCES `auth_permission` (`id`) DEFERRABLE INITIALLY DEFERRED) ENGINE=InnoDB DEFAULT CHARSET=utf8mb4 COLLATE=utf8mb4_unicode_ci;


CREATE TABLE IF NOT EXISTS `auth_user_groups` (`id` INT AUTO_INCREMENT PRIMARY KEY, `user_id` INT NOT NULL REFERENCES `auth_user` (`id`) DEFERRABLE INITIALLY DEFERRED, `group_id` INT NOT NULL REFERENCES `auth_group` (`id`) DEFERRABLE INITIALLY DEFERRED) ENGINE=InnoDB DEFAULT CHARSET=utf8mb4 COLLATE=utf8mb4_unicode_ci;


CREATE TABLE IF NOT EXISTS `auth_user_user_permissions` (`id` INT AUTO_INCREMENT PRIMARY KEY, `user_id` INT NOT NULL REFERENCES `auth_user` (`id`) DEFERRABLE INITIALLY DEFERRED, `permission_id` INT NOT NULL REFERENCES `auth_permission` (`id`) DEFERRABLE INITIALLY DEFERRED) ENGINE=InnoDB DEFAULT CHARSET=utf8mb4 COLLATE=utf8mb4_unicode_ci;


CREATE TABLE IF NOT EXISTS `django_admin_log` (`id` INT AUTO_INCREMENT PRIMARY KEY, `object_id` text NULL, `object_repr` varchar(200) NOT NULL, `action_flag` smallint unsigned NOT NULL CHECK (`action_flag` >= 0), `change_message` text NOT NULL, `content_type_id` INT NULL REFERENCES `django_content_type` (`id`) DEFERRABLE INITIALLY DEFERRED, `user_id` INT NOT NULL REFERENCES `auth_user` (`id`) DEFERRABLE INITIALLY DEFERRED, `action_time` datetime NOT NULL) ENGINE=InnoDB DEFAULT CHARSET=utf8mb4 COLLATE=utf8mb4_unicode_ci;


CREATE TABLE IF NOT EXISTS `django_content_type` (`id` INT AUTO_INCREMENT PRIMARY KEY, `app_label` varchar(100) NOT NULL, `model` varchar(100) NOT NULL) ENGINE=InnoDB DEFAULT CHARSET=utf8mb4 COLLATE=utf8mb4_unicode_ci;


CREATE TABLE IF NOT EXISTS `auth_permission` (`id` INT AUTO_INCREMENT PRIMARY KEY, `content_type_id` INT NOT NULL REFERENCES `django_content_type` (`id`) DEFERRABLE INITIALLY DEFERRED, `codename` varchar(100) NOT NULL, `name` varchar(255) NOT NULL) ENGINE=InnoDB DEFAULT CHARSET=utf8mb4 COLLATE=utf8mb4_unicode_ci;


CREATE TABLE IF NOT EXISTS `auth_group` (`id` INT AUTO_INCREMENT PRIMARY KEY, `name` varchar(150) NOT NULL UNIQUE) ENGINE=InnoDB DEFAULT CHARSET=utf8mb4 COLLATE=utf8mb4_unicode_ci;


CREATE TABLE IF NOT EXISTS `auth_user` (`id` INT AUTO_INCREMENT PRIMARY KEY, `password` varchar(128) NOT NULL, `last_login` datetime NULL, `is_superuser` bool NOT NULL, `username` varchar(150) NOT NULL UNIQUE, `last_name` varchar(150) NOT NULL, `email` varchar(254) NOT NULL, `is_staff` bool NOT NULL, `is_active` bool NOT NULL, `date_joined` datetime NOT NULL, `first_name` varchar(150) NOT NULL) ENGINE=InnoDB DEFAULT CHARSET=utf8mb4 COLLATE=utf8mb4_unicode_ci;


CREATE TABLE IF NOT EXISTS `django_session` (`session_key` varchar(40) NOT NULL PRIMARY KEY, `session_data` text NOT NULL, `expire_date` datetime NOT NULL) ENGINE=InnoDB DEFAULT CHARSET=utf8mb4 COLLATE=utf8mb4_unicode_ci;


CREATE TABLE IF NOT EXISTS `exams_learnertotalscore` (`learner_id` bigint NOT NULL PRIMARY KEY REFERENCES `learners_learnerregister` (`id`) DEFERRABLE INITIALLY DEFERRED, `total_score` real NOT NULL, `exam_type_id` INT NULL REFERENCES `exams_examtype` (`exam_id`) DEFERRABLE INITIALLY DEFERRED) ENGINE=InnoDB DEFAULT CHARSET=utf8mb4 COLLATE=utf8mb4_unicode_ci;


CREATE TABLE IF NOT EXISTS `learners_feesmodel` (`id` INT AUTO_INCREMENT PRIMARY KEY, `register_date` datetime NOT NULL, `amount` INT NOT NULL, `payment_type` varchar(100) NOT NULL, `received_by` varchar(100) NOT NULL, `learner_id_id` bigint NOT NULL REFERENCES `learners_learnerregister` (`id`) DEFERRABLE INITIALLY DEFERRED, `payment_method` varchar(20) NOT NULL, `payment_id` INT NOT NULL) ENGINE=InnoDB DEFAULT CHARSET=utf8mb4 COLLATE=utf8mb4_unicode_ci;


CREATE TABLE IF NOT EXISTS `exams_subject` (`name` varchar(100) NOT NULL, `subject_id` INT AUTO_INCREMENT PRIMARY KEY) ENGINE=InnoDB DEFAULT CHARSET=utf8mb4 COLLATE=utf8mb4_unicode_ci;


CREATE TABLE IF NOT EXISTS `exams_subject_grades` (`id` INT AUTO_INCREMENT PRIMARY KEY, `subject_id` INT NOT NULL REFERENCES `exams_subject` (`subject_id`) DEFERRABLE INITIALLY DEFERRED, `grade_id` bigint NOT NULL REFERENCES `learners_grade` (`id`) DEFERRABLE INITIALLY DEFERRED) ENGINE=InnoDB DEFAULT CHARSET=utf8mb4 COLLATE=utf8mb4_unicode_ci;


CREATE TABLE IF NOT EXISTS `exams_examresult` (`id` INT AUTO_INCREMENT PRIMARY KEY, `date_examined` date NULL, `learner_id_id` bigint NOT NULL REFERENCES `learners_learnerregister` (`id`) DEFERRABLE INITIALLY DEFERRED, `score` real NULL, `subject_id` INT NOT NULL REFERENCES `exams_subject` (`subject_id`) DEFERRABLE INITIALLY DEFERRED, `exam_type_id` INT NULL REFERENCES `exams_examtype` (`exam_id`) DEFERRABLE INITIALLY DEFERRED, `teacher_comment` text NOT NULL) ENGINE=InnoDB DEFAULT CHARSET=utf8mb4 COLLATE=utf8mb4_unicode_ci;


CREATE TABLE IF NOT EXISTS `learners_school` (`id` INT AUTO_INCREMENT PRIMARY KEY, `name` varchar(100) NOT NULL, `principal_remark` text NOT NULL) ENGINE=InnoDB DEFAULT CHARSET=utf8mb4 COLLATE=utf8mb4_unicode_ci;


CREATE TABLE IF NOT EXISTS `learners_grade` (`id` INT AUTO_INCREMENT PRIMARY KEY, `grade_name` varchar(100) NOT NULL UNIQUE, `grade_description` text NOT NULL, `class_teacher_remark` text NOT NULL) ENGINE=InnoDB DEFAULT CHARSET=utf8mb4 COLLATE=utf8mb4_unicode_ci;


CREATE TABLE IF NOT EXISTS `learners_learnerregister` (`id` INT AUTO_INCREMENT PRIMARY KEY, `register_date` datetime NOT NULL, `date_of_birth` date NOT NULL, `name` varchar(100) NOT NULL, `gender` varchar(100) NOT NULL, `name_of_parent` varchar(100) NOT NULL, `parent_contact` varchar(100) NOT NULL, `learner_id` INT NOT NULL UNIQUE, `grade_id` bigint NOT NULL REFERENCES `learners_grade` (`id`) DEFERRABLE INITIALLY DEFERRED, `beans_balance` decimal NOT NULL, `fee_balance` decimal NOT NULL, `maize_balance` decimal NOT NULL) ENGINE=InnoDB DEFAULT CHARSET=utf8mb4 COLLATE=utf8mb4_unicode_ci;


CREATE TABLE IF NOT EXISTS `exams_examtype` (`name` varchar(100) NOT NULL, `date_administered` date NOT NULL, `exam_id` INT AUTO_INCREMENT PRIMARY KEY, `term` varchar(100) NOT NULL) ENGINE=InnoDB DEFAULT CHARSET=utf8mb4 COLLATE=utf8mb4_unicode_ci;


CREATE TABLE IF NOT EXISTS authenticator_custompermission (id INT AUTO_INCREMENT PRIMARY KEY, name varchar (255) NOT NULL UNIQUE, codename varchar (100) NOT NULL UNIQUE, content_type_id INT NOT NULL REFERENCES django_content_type (id) DEFERRABLE INITIALLY DEFERRED) ENGINE=InnoDB DEFAULT CHARSET=utf8mb4 COLLATE=utf8mb4_unicode_ci;


CREATE TABLE IF NOT EXISTS authenticator_role (id INT AUTO_INCREMENT PRIMARY KEY, name varchar (100) NOT NULL UNIQUE, description text NOT NULL) ENGINE=InnoDB DEFAULT CHARSET=utf8mb4 COLLATE=utf8mb4_unicode_ci;


CREATE TABLE IF NOT EXISTS authenticator_customuser (id INT AUTO_INCREMENT PRIMARY KEY, password varchar (128) NOT NULL, last_login datetime, is_superuser bool NOT NULL, username varchar (150) NOT NULL UNIQUE, first_name varchar (150) NOT NULL, last_name varchar (150) NOT NULL, email varchar (254) NOT NULL, is_staff bool NOT NULL, is_active bool NOT NULL, date_joined datetime NOT NULL, user_type varchar (20) NOT NULL, role_id bigint REFERENCES authenticator_role (id) DEFERRABLE INITIALLY DEFERRED) ENGINE=InnoDB DEFAULT CHARSET=utf8mb4 COLLATE=utf8mb4_unicode_ci;


CREATE TABLE IF NOT EXISTS authenticator_rolepermission (id INT AUTO_INCREMENT PRIMARY KEY, permission_id bigint NOT NULL REFERENCES authenticator_custompermission (id) DEFERRABLE INITIALLY DEFERRED, role_id bigint NOT NULL REFERENCES authenticator_role (id) DEFERRABLE INITIALLY DEFERRED) ENGINE=InnoDB DEFAULT CHARSET=utf8mb4 COLLATE=utf8mb4_unicode_ci;


CREATE TABLE IF NOT EXISTS authenticator_userprofile (id INT AUTO_INCREMENT PRIMARY KEY, bio text NOT NULL, date_of_birth date, profile_picture varchar (100), user_id bigint NOT NULL UNIQUE REFERENCES authenticator_customuser (id) DEFERRABLE INITIALLY DEFERRED) ENGINE=InnoDB DEFAULT CHARSET=utf8mb4 COLLATE=utf8mb4_unicode_ci;


CREATE TABLE IF NOT EXISTS authenticator_customuser_groups (id INT AUTO_INCREMENT PRIMARY KEY, customuser_id bigint NOT NULL REFERENCES authenticator_customuser (id) DEFERRABLE INITIALLY DEFERRED, group_id INT NOT NULL REFERENCES auth_group (id) DEFERRABLE INITIALLY DEFERRED) ENGINE=InnoDB DEFAULT CHARSET=utf8mb4 COLLATE=utf8mb4_unicode_ci;


CREATE TABLE IF NOT EXISTS authenticator_customuser_custom_permissions (id INT AUTO_INCREMENT PRIMARY KEY, customuser_id bigint NOT NULL REFERENCES authenticator_customuser (id) DEFERRABLE INITIALLY DEFERRED, custompermission_id bigint NOT NULL REFERENCES authenticator_custompermission (id) DEFERRABLE INITIALLY DEFERRED) ENGINE=InnoDB DEFAULT CHARSET=utf8mb4 COLLATE=utf8mb4_unicode_ci;


CREATE TABLE IF NOT EXISTS authenticator_customuser_user_permissions (id INT AUTO_INCREMENT PRIMARY KEY, customuser_id bigint NOT NULL REFERENCES authenticator_customuser (id) DEFERRABLE INITIALLY DEFERRED, permission_id INT NOT NULL REFERENCES auth_permission (id) DEFERRABLE INITIALLY DEFERRED) ENGINE=InnoDB DEFAULT CHARSET=utf8mb4 COLLATE=utf8mb4_unicode_ci;


CREATE TABLE IF NOT EXISTS `administrator_academiccalendar` (`id` INT AUTO_INCREMENT PRIMARY KEY, `title` varchar(100) NOT NULL, `description` text NOT NULL, `start_date` date NOT NULL, `end_date` date NOT NULL, `event_type` varchar(10) NOT NULL) ENGINE=InnoDB DEFAULT CHARSET=utf8mb4 COLLATE=utf8mb4_unicode_ci;


CREATE TABLE IF NOT EXISTS `administrator_curriculum` (`id` INT AUTO_INCREMENT PRIMARY KEY, `name` varchar(100) NOT NULL, `description` text NOT NULL, `grade_id` bigint NOT NULL REFERENCES `learners_grade` (`id`) DEFERRABLE INITIALLY DEFERRED) ENGINE=InnoDB DEFAULT CHARSET=utf8mb4 COLLATE=utf8mb4_unicode_ci;


CREATE TABLE IF NOT EXISTS `administrator_curriculum_subjects` (`id` INT AUTO_INCREMENT PRIMARY KEY, `curriculum_id` bigint NOT NULL REFERENCES `administrator_curriculum` (`id`) DEFERRABLE INITIALLY DEFERRED, `subject_id` INT NOT NULL REFERENCES `exams_subject` (`subject_id`) DEFERRABLE INITIALLY DEFERRED) ENGINE=InnoDB DEFAULT CHARSET=utf8mb4 COLLATE=utf8mb4_unicode_ci;


CREATE TABLE IF NOT EXISTS `administrator_teacherassignment` (`id` INT AUTO_INCREMENT PRIMARY KEY, `grade_id` bigint NOT NULL REFERENCES `learners_grade` (`id`) DEFERRABLE INITIALLY DEFERRED, `subject_id` INT NOT NULL REFERENCES `exams_subject` (`subject_id`) DEFERRABLE INITIALLY DEFERRED, `teacher_id` bigint NOT NULL REFERENCES `administrator_teacher` (`id`) DEFERRABLE INITIALLY DEFERRED) ENGINE=InnoDB DEFAULT CHARSET=utf8mb4 COLLATE=utf8mb4_unicode_ci;


CREATE TABLE IF NOT EXISTS `administrator_timetable` (`id` INT AUTO_INCREMENT PRIMARY KEY, `day` varchar(10) NOT NULL, `start_time` time NOT NULL, `end_time` time NOT NULL, `grade_id` bigint NOT NULL REFERENCES `learners_grade` (`id`) DEFERRABLE INITIALLY DEFERRED, `subject_id` INT NOT NULL REFERENCES `exams_subject` (`subject_id`) DEFERRABLE INITIALLY DEFERRED) ENGINE=InnoDB DEFAULT CHARSET=utf8mb4 COLLATE=utf8mb4_unicode_ci;


CREATE TABLE IF NOT EXISTS `administrator_attendance` (`id` INT AUTO_INCREMENT PRIMARY KEY, `date` date NOT NULL, `learner_id` bigint NOT NULL REFERENCES `learners_learnerregister` (`id`) DEFERRABLE INITIALLY DEFERRED, `status` varchar(10) NOT NULL) ENGINE=InnoDB DEFAULT CHARSET=utf8mb4 COLLATE=utf8mb4_unicode_ci;


CREATE TABLE IF NOT EXISTS `exams_behavioralassessment` (`id` INT AUTO_INCREMENT PRIMARY KEY, `category` varchar(50) NOT NULL, `rating` varchar(20) NOT NULL, `comment` text NOT NULL, `exam_type_id` INT NOT NULL REFERENCES `exams_examtype` (`exam_id`) DEFERRABLE INITIALLY DEFERRED, `learner_id` bigint NOT NULL REFERENCES `learners_learnerregister` (`id`) DEFERRABLE INITIALLY DEFERRED) ENGINE=InnoDB DEFAULT CHARSET=utf8mb4 COLLATE=utf8mb4_unicode_ci;


CREATE TABLE IF NOT EXISTS `exams_extracurricularactivity` (`id` INT AUTO_INCREMENT PRIMARY KEY, `activity` varchar(100) NOT NULL, `role` varchar(50) NOT NULL, `achievement` text NULL, `exam_type_id` INT NOT NULL REFERENCES `exams_examtype` (`exam_id`) DEFERRABLE INITIALLY DEFERRED, `learner_id` bigint NOT NULL REFERENCES `learners_learnerregister` (`id`) DEFERRABLE INITIALLY DEFERRED) ENGINE=InnoDB DEFAULT CHARSET=utf8mb4 COLLATE=utf8mb4_unicode_ci;


CREATE TABLE IF NOT EXISTS `exams_learninggoal` (`id` INT AUTO_INCREMENT PRIMARY KEY, `goal` text NOT NULL, `status` varchar(20) NOT NULL, `exam_type_id` INT NOT NULL REFERENCES `exams_examtype` (`exam_id`) DEFERRABLE INITIALLY DEFERRED, `learner_id` bigint NOT NULL REFERENCES `learners_learnerregister` (`id`) DEFERRABLE INITIALLY DEFERRED) ENGINE=InnoDB DEFAULT CHARSET=utf8mb4 COLLATE=utf8mb4_unicode_ci;


CREATE TABLE IF NOT EXISTS `exams_skillsassessment` (`id` INT AUTO_INCREMENT PRIMARY KEY, `skill` varchar(50) NOT NULL, `rating` varchar(20) NOT NULL, `exam_type_id` INT NOT NULL REFERENCES `exams_examtype` (`exam_id`) DEFERRABLE INITIALLY DEFERRED, `learner_id` bigint NOT NULL REFERENCES `learners_learnerregister` (`id`) DEFERRABLE INITIALLY DEFERRED) ENGINE=InnoDB DEFAULT CHARSET=utf8mb4 COLLATE=utf8mb4_unicode_ci;


CREATE TABLE IF NOT EXISTS `exams_socialemotionaldevelopment` (`id` INT AUTO_INCREMENT PRIMARY KEY, `category` varchar(50) NOT NULL, `rating` varchar(20) NOT NULL, `comment` text NOT NULL, `exam_type_id` INT NOT NULL REFERENCES `exams_examtype` (`exam_id`) DEFERRABLE INITIALLY DEFERRED, `learner_id` bigint NOT NULL REFERENCES `learners_learnerregister` (`id`) DEFERRABLE INITIALLY DEFERRED) ENGINE=InnoDB DEFAULT CHARSET=utf8mb4 COLLATE=utf8mb4_unicode_ci;


CREATE TABLE IF NOT EXISTS `exams_specialachievement` (`id` INT AUTO_INCREMENT PRIMARY KEY, `achievement` text NOT NULL, `date` date NOT NULL, `exam_type_id` INT NOT NULL REFERENCES `exams_examtype` (`exam_id`) DEFERRABLE INITIALLY DEFERRED, `learner_id` bigint NOT NULL REFERENCES `learners_learnerregister` (`id`) DEFERRABLE INITIALLY DEFERRED) ENGINE=InnoDB DEFAULT CHARSET=utf8mb4 COLLATE=utf8mb4_unicode_ci;


CREATE TABLE IF NOT EXISTS `exams_standardizedtestscore` (`id` INT AUTO_INCREMENT PRIMARY KEY, `test_name` varchar(100) NOT NULL, `score` decimal NOT NULL, `date` date NOT NULL, `exam_type_id` INT NOT NULL REFERENCES `exams_examtype` (`exam_id`) DEFERRABLE INITIALLY DEFERRED, `learner_id` bigint NOT NULL REFERENCES `learners_learnerregister` (`id`) DEFERRABLE INITIALLY DEFERRED) ENGINE=InnoDB DEFAULT CHARSET=utf8mb4 COLLATE=utf8mb4_unicode_ci;


CREATE TABLE IF NOT EXISTS `exams_studyhabit` (`id` INT AUTO_INCREMENT PRIMARY KEY, `category` varchar(50) NOT NULL, `rating` varchar(20) NOT NULL, `comment` text NOT NULL, `exam_type_id` INT NOT NULL REFERENCES `exams_examtype` (`exam_id`) DEFERRABLE INITIALLY DEFERRED, `learner_id` bigint NOT NULL REFERENCES `learners_learnerregister` (`id`) DEFERRABLE INITIALLY DEFERRED) ENGINE=InnoDB DEFAULT CHARSET=utf8mb4 COLLATE=utf8mb4_unicode_ci;


CREATE TABLE IF NOT EXISTS `exams_supportservice` (`id` INT AUTO_INCREMENT PRIMARY KEY, `service_type` varchar(50) NOT NULL, `description` text NOT NULL, `start_date` date NOT NULL, `end_date` date NULL, `exam_type_id` INT NOT NULL REFERENCES `exams_examtype` (`exam_id`) DEFERRABLE INITIALLY DEFERRED, `learner_id` bigint NOT NULL REFERENCES `learners_learnerregister` (`id`) DEFERRABLE INITIALLY DEFERRED) ENGINE=InnoDB DEFAULT CHARSET=utf8mb4 COLLATE=utf8mb4_unicode_ci;


CREATE TABLE IF NOT EXISTS `exams_teachercomment` (`id` INT AUTO_INCREMENT PRIMARY KEY, `comment` text NOT NULL, `exam_type_id` INT NOT NULL REFERENCES `exams_examtype` (`exam_id`) DEFERRABLE INITIALLY DEFERRED, `learner_id` bigint NOT NULL REFERENCES `learners_learnerregister` (`id`) DEFERRABLE INITIALLY DEFERRED, `subject_id` INT NULL REFERENCES `exams_subject` (`subject_id`) DEFERRABLE INITIALLY DEFERRED, `teacher_id` bigint NOT NULL REFERENCES `authenticator_customuser` (`id`) DEFERRABLE INITIALLY DEFERRED) ENGINE=InnoDB DEFAULT CHARSET=utf8mb4 COLLATE=utf8mb4_unicode_ci;


CREATE TABLE IF NOT EXISTS `exams_attendance` (`id` INT AUTO_INCREMENT PRIMARY KEY, `date` date NOT NULL, `status` varchar(10) NOT NULL, `learner_id` bigint NOT NULL REFERENCES `learners_learnerregister` (`id`) DEFERRABLE INITIALLY DEFERRED) ENGINE=InnoDB DEFAULT CHARSET=utf8mb4 COLLATE=utf8mb4_unicode_ci;


CREATE TABLE IF NOT EXISTS `exams_progressreport` (`id` INT AUTO_INCREMENT PRIMARY KEY, `generated_date` date NOT NULL, `overall_comment` text NOT NULL, `areas_for_improvement` text NOT NULL, `future_recommendations` text NOT NULL, `principal_signature` bool NOT NULL, `parent_signature` bool NOT NULL, `exam_type_id` INT NOT NULL REFERENCES `exams_examtype` (`exam_id`) DEFERRABLE INITIALLY DEFERRED, `learner_id` bigint NOT NULL REFERENCES `learners_learnerregister` (`id`) DEFERRABLE INITIALLY DEFERRED) ENGINE=InnoDB DEFAULT CHARSET=utf8mb4 COLLATE=utf8mb4_unicode_ci;


CREATE TABLE IF NOT EXISTS `administrator_teacher` (`id` INT AUTO_INCREMENT PRIMARY KEY, `name` varchar(100) NOT NULL, `employee_id` varchar(20) NOT NULL UNIQUE, `date_of_birth` date NOT NULL, `email` varchar(254) NOT NULL, `date_joined` date NOT NULL, `address` text NULL, `is_class_teacher` bool NOT NULL, `phone_number` varchar(15) NULL) ENGINE=InnoDB DEFAULT CHARSET=utf8mb4 COLLATE=utf8mb4_unicode_ci;


CREATE TABLE IF NOT EXISTS `administrator_teacher_subjects` (`id` INT AUTO_INCREMENT PRIMARY KEY, `teacher_id` bigint NOT NULL REFERENCES `administrator_teacher` (`id`) DEFERRABLE INITIALLY DEFERRED, `subject_id` INT NOT NULL REFERENCES `exams_subject` (`subject_id`) DEFERRABLE INITIALLY DEFERRED) ENGINE=InnoDB DEFAULT CHARSET=utf8mb4 COLLATE=utf8mb4_unicode_ci;


CREATE TABLE IF NOT EXISTS `learners_classlevel` (`id` INT AUTO_INCREMENT PRIMARY KEY, `level_name` varchar(100) NOT NULL UNIQUE, `level_description` text NOT NULL, `class_representative_female_id` bigint NULL REFERENCES `learners_learnerregister` (`id`) DEFERRABLE INITIALLY DEFERRED, `class_representative_male_id` bigint NULL REFERENCES `learners_learnerregister` (`id`) DEFERRABLE INITIALLY DEFERRED, `class_teacher_id` bigint NULL REFERENCES `administrator_teacher` (`id`) DEFERRABLE INITIALLY DEFERRED) ENGINE=InnoDB DEFAULT CHARSET=utf8mb4 COLLATE=utf8mb4_unicode_ci;


CREATE TABLE IF NOT EXISTS `fees_feetype` (`id` INT AUTO_INCREMENT PRIMARY KEY, `name` varchar(100) NOT NULL, `description` text NOT NULL) ENGINE=InnoDB DEFAULT CHARSET=utf8mb4 COLLATE=utf8mb4_unicode_ci;


CREATE TABLE IF NOT EXISTS `fees_feerecord` (`id` INT AUTO_INCREMENT PRIMARY KEY, `amount` decimal NOT NULL, `due_date` date NOT NULL, `paid_amount` decimal NOT NULL, `paid_date` date NULL, `status` varchar(10) NOT NULL, `learner_id` bigint NOT NULL REFERENCES `learners_learnerregister` (`id`) DEFERRABLE INITIALLY DEFERRED, `fee_type_id` bigint NOT NULL REFERENCES `fees_feetype` (`id`) DEFERRABLE INITIALLY DEFERRED) ENGINE=InnoDB DEFAULT CHARSET=utf8mb4 COLLATE=utf8mb4_unicode_ci;


